settings.tooltipFunction:
var content = '<div style="font-family: Roboto; background-color: white; padding: 20px; border-radius: 5px;">' +
                 '<div style="font-size: 16px; font-weight: 500; padding-bottom: 8px; color:#5D3FD3;">${entityLabel}</div>';

var deviceType = data['Type'];
if (typeof deviceType !== undefined) {
    content += '<div style="font-size: 12px; font-weight: normal;">' + getInfoByDeviceType(deviceType) + '</div>';
}
content += '</div>';
return content;

function getInfoByDeviceType(type) {
    switch (type) {
        case 'Passage':
            return '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">People Coming in: ${period_in:0}</div>' +
                   '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">People Going out: ${period_out:0}</div>' +
                  // '<div style="color:#004170;font-size: 14px; font-weight: 450; padding-bottom: 4px;">Total People Coming in: ${total_in:0}</div>' +
                  // '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Total People Going out: ${total_out:0}</div>' +
                   '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Battery: ${battery:0} %</div>';
        case 'Chiller':
        case 'Freezer':    
            return 'Temperature: ${temperature:1} °C';
       // case 'Tof':
         //   return '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">People in Queue: ${line_1_period_in:0}</div>' +
           //        '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">People Going out: ${line_1_period_out:0}</div>' ;
                 //  '<div style="color:#004170;font-size: 14px; font-weight: 450; padding-bottom: 4px;">Total People: ${line_1_total_in:0}</div>' +
                  // '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Total People Going out: ${line_1_total_out:0}</div>';
        case 'Water':
            return '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Leakage Status: ${leakage_status}</div>' +
                   '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Battery: ${battery:0} %</div>';
        case 'Door Sensor':
            var open = data['open'] === 'true';
            return 'State: ' + (open ? 'Open' : 'Closed');
        case 'Motion Sensor':
            var movement = data['movement'] === 'true';
            return 'Movement detection: ' + (movement ? 'Detected' : 'None');
        case 'Occupancy Sensor':
            return '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Occupancy Status: ${occupancy}</div>' +
                   '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Position from the device: ${distance:2} cm</div>' +
                   //'<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Duration : ${duration:2} min</div>' +
                   '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Battery: ${battery:0} %</div>'
                  ;

        case 'Odour':
            return '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Ammonia (NH₃): ${nh3:2} ppm</div>' +
                   '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Air Quality (NH₃): ${nh3des}</div>' +
                   '<div style="color:#004170;font-size: 14px; font-weight: 450; padding-bottom: 4px;">Sulphide (H₂S): ${h2s:2} ppm</div>' +
                   '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Air Quality (H₂S): ${h2sdes}</div>' +
                   '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Temperature: ${temperature:2} °C</div>' +
                   '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Humidity: ${humidity:2} %rh</div>' +
                   '<div style="color:#004170;font-size: 14px; font-weight: 450;padding-bottom: 4px;">Battery: ${battery:0}%</div>';
        default:
            return 'TODO';
    }
}

function sendDataToSensor(maintenanceValue, deviceId) {
    var xhr = new XMLHttpRequest();
    xhr.open("POST", "https://YOUR_THINGSBOARD_API_URL/api/v1/" + deviceId + "/telemetry", true);
    xhr.setRequestHeader("Content-Type", "application/json");

    // Payload: sending maintenance status
    var payload = JSON.stringify({
        maintenance: maintenanceValue
    });

    xhr.send(payload);

    xhr.onreadystatechange = function() {
        if (xhr.readyState === 4 && xhr.status === 200) {
            console.log("Maintenance status sent successfully.");
        } else if (xhr.readyState === 4) {
            console.error("Failed to send maintenance status:", xhr.responseText);
        }
    };
}

