actionCellButton.customFunction:
let $injector = widgetContext.$scope.$injector;
let customDialog = $injector.get(widgetContext.servicesMap.get('customDialog'));
let attributeService = $injector.get(widgetContext.servicesMap.get('attributeService'));
let http = $injector.get(widgetContext.servicesMap.get('http')); // Required for sending telemetry data

openEditMaintenanceDialog();

function openEditMaintenanceDialog() {
    customDialog.customDialog(htmlTemplate, EditMaintenanceDialogController).subscribe();
}

function EditMaintenanceDialogController(instance) {
    let vm = instance;
    let maintenanceState = null;

    vm.widgetContext = widgetContext;

    // Define the form group for maintenance
    vm.editMaintenanceFormGroup = vm.fb.group({
        maintenance: [null, [vm.validators.required]],
    });

    // Load current maintenance value
    getMaintenanceAttribute();

    vm.cancel = function() {
        vm.dialogRef.close(null);
    };

    vm.save = function() {
        vm.editMaintenanceFormGroup.markAsPristine();
        const newMaintenanceValue = vm.editMaintenanceFormGroup.get('maintenance').value;

        // Save the maintenance attribute
        saveMaintenanceAttribute(newMaintenanceValue).subscribe(() => {
            // Call a function to update telemetry status after saving the attribute
            updateOccupancyTelemetry(newMaintenanceValue);
            vm.dialogRef.close(null);
        });
    };

    function getMaintenanceAttribute() {
        // Retrieve the 'maintenance' attribute from the device
        attributeService.getEntityAttributes(entityId, 'SERVER_SCOPE').subscribe(attributes => {
            const maintenanceAttr = attributes.find(attr => attr.key === 'maintenance');
            if (maintenanceAttr) {
                maintenanceState = maintenanceAttr.value;
                vm.editMaintenanceFormGroup.patchValue({maintenance: maintenanceState});
            }
        });
    }

    function saveMaintenanceAttribute(newValue) {
        // Save the updated 'maintenance' attribute to the device
        const attributesArray = [{ key: 'maintenance', value: newValue }];
        return attributeService.saveEntityAttributes(entityId, "SERVER_SCOPE", attributesArray);
    }

    function updateOccupancyTelemetry(newValue) {
        // Prepare the occupancy telemetry data
        const occupancyValue = newValue === 1 ? 'maintenance' : 'occupied';  // Assuming 1 means 'ON' and 0 means 'OFF'

        // Call the saveEntityTimeseries function to update the telemetry
        saveEntityTimeseries(entityId.entityType, entityId.id, [{ key: 'occupancy', value: occupancyValue }]);
    }

    // Function to update telemetry via the ThingsBoard API (adapted from your previous code)
    function saveEntityTimeseries(entityType, entityId, telemetries) {
        let telemetriesData = {};
        for (let i = 0; i < telemetries.length; i++) {
            if (telemetries[i].value !== undefined && telemetries[i].value !== null) {
                telemetriesData[telemetries[i].key] = telemetries[i].value;
            }
        }
        if (Object.keys(telemetriesData).length) {
            const url = '/api/plugins/telemetry/' + entityType + '/' + entityId + '/timeseries/scope';
            return http.post(url, telemetriesData).subscribe(
                (response) => {
                    console.log('Occupancy telemetry updated successfully:', response);
                },
                (error) => {
                    console.error('Error updating occupancy telemetry:', error);
                }
            );
        }
    }
}

